import React,{useState, useEffect} from 'react'
import styled from 'styled-components'
import {Link, NavLink} from 'react-router-dom'
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';

const Mobilenavbar = styled.div`
background-color:red;
display:flex;
height:10vh;
justify-content:space-between;
align-items:center;
`





function Mobile(){
const [slider, setslider]  = useState(false);
    return (
       <>
            <Mobilenavbar>
                <FaIcons.FaBars onClick={()=> setslider(!slider)} className="icon"/>
                
                <div className="mobilelogo">FRONTVIEW</div>
            </Mobilenavbar>
            
            <div className={slider ? 'nav-menus' :' nav-menu'}>

                    <ul>
                           <li >
                            
                           <AiIcons.AiOutlineClose  onClick={()=> setslider(!slider)}/>

                           </li>
                           <li  ><Link to='#' className='menu-bar'>HOM</Link></li> 
                           <li ><Link to='#' className='menu-bar'>ABOUT</Link></li> 
                           <li ><Link to='#' className='menu-bar'>CONTACT</Link></li> 
                    </ul>




            </div>
            
       </>
    )
}







//......................................................................................
const Navbar = styled.div`
background-color: black;
color:white;
display:flex;
justify-content:space-between;
padding:1%;
width:100%;
`
const Way = styled.ul`
display:flex;
justify-content:space-around;
`

const Logo = styled.div`
color: white;
    font-family: ;
    min-width: 100%;
    text-align: center;
    font-family: cursive;
    font-size: 2rem;
`



function Nav(){





return(
<>

<div class="navbar">
            <div class="logo">
            FrontView
           </div>
            <div class="link">
                  <ul>
                  <li><NavLink to="/" >HOME</NavLink></li>
                  <li><NavLink to="/project">ABOUT</NavLink></li>
                  <li><NavLink to="/contact">CONTACT</NavLink></li>
                  </ul>
            </div>


  </div>

<Mobile/>


</>




)


}
export default Nav
